import React, {Component} from 'react';

class Card extends Component{

    render(){
        return(
            <div class="card card-body bg-light">
              <h5 class="card-title font-weight-bold">{this.props.title}</h5>
              <p class="card-text">{this.props.text}</p>
            </div>
        );
    }
}
export default Card;
